                "multilinkval": "ACCOUNT:1413912647",
                "name": "185680538 - SO-19-02993 - Display not working with laptop connectivitiy",
                "notes": "The 2nd floor huddle room was having issues. Unfortunately it was the cable was missing. I also had to change the display setting on the tv from stretch (which makes your laptop image too large and you can not see parts of the image) to dot by dot which basically shows the image of your laptop and doesn't engage any scaling. \r\n    \r\nThey also had me go over the system in 460,470 the large multipurpose room with the projectors to review gear with them and what gear was for what basically to educate them on the gear in the main large rack room.  I did also look into gear that is onsite in the av storage room. I showed them to use the quick start for the vtc so it would wake up properly. They (Sejal) said the camera located at the projector didnt wake up however it was working when I looked at it.\r\n \r\nThey have a large meeting and Sejal was busy and I didnt want to keep him since he was escorting me. I was only onsite for short periods of time on this trip. \r\n \r\nI would probably recommend going through all of these systems and updating the Biamp firmware however this would be pretty intensive since we would need to re-confirm with Vtc help desk that the systems were back and working properly. ",
                "object_id": "c998e4bd28be46d5ad25022d476f3e95",
