                "multilinkval": "ACCOUNT:1341540313",
                "name": "528304379 - SO-22-05804 - Cable Tuners non responsive.",
                "notes": "Discovered all three of their cable tuners were no longer functioning they would power on but I couldnt get a menu up or any response from them I called contemporary research technical support and they said that it was a known issue with a failed chip and that they would need to be sent in for repair.\r\n-While they were being repaired John Wade requested that I set them up with a temporary tuner so they could watch March madness they had an event planned.\r\n-I reinstall the repaired tuners did some troubleshooting and some testing. Tyler had to fix some programming for the tuner control to work. Ther is a PO associated with this case for a repair of the tuners\r\n",
