                "entry_type": "Cases",
                "id": "1119704103",
                "modified_id": {
                    "content": "bb7917d8d5d74640b067d24325c92ead",
                    "displayValue": "Danny Chenault",
                    "type": "",
                    "uri": "https://na.longjump.com/networking/rest/user/bb7917d8d5d74640b067d24325c92ead"
                },
                "multicaselink": {
                    "content": "346836928",
                    "displayValue": "SO-22-05789 - Site visit Ritz-Carlton.",
                    "type": "21c64e715c50468faf9e031b2967020d",
                    "uri": "https://na.longjump.com/networking/rest/record/21c64e715c50468faf9e031b2967020d/346836928"
                },
                "multilinkval": "21c64e715c50468faf9e031b2967020d:346836928",
                "name": "1119704103 - SO-22-05789 - Site visit Ritz-Carlton.",
                "notes": " I was on site the first issue they are having is in their ballroom they have a CD player that they also use as an aux input, its no longer working. its Made by Beolab The speakers are powered and are proprietary to the device although I did research and find that you can buy a dongle to make the speakers work with other receivers. I tried to send a signal directly to the speakers but was unable to get any sound to go through them from the cable at the CD player. I did notice a couple of them were off. I got on the lift and went up and turned one of them back on and when I went back down the lift died and needed to be charged So I couldnt go up and investigate anymore. I need to verify that the speakers are working if were going to quote them some thing that incorporates the speakers were going to need the dongle from the manufacturer it takes the nine pin din and makes it into two RCAs. I need to verify the cabling is good and or the cable path to run new cabling. Then we can quote them some thing as a replacement for the CD player they said they would like an IPad. \r\n\r\n\r\n\r\nThe second thing they had me look at where Mic inputs that they had in various rooms. I believe one of them was called the boiler room.    They have no drawing and they werent sure where the mic inputs went to. The sound was no longer working in the room from the inputs or from the hotel sound system. I traced the lines back to a DSP mixer made by Crown. When I traced the path out of the DSP/mixer into the Crown amplifier array. I discovered that the amplifier that serves that room and various other zones in the hotel would no longer power on. which was the next thing they wanted me to look at. I replaced the cord and plugged it directly into the outlet and still nothing. I swapped the iec cord from one of the working amps still nothing.The Crown amplifier will need to be replaced. I recommend they use the one that Crown recommends as the replacement to avoid having to reconfigure their system and make for an easy swap. \r\n\r\n\r\n\r\nI looked at a Soundsystem that they have in their lobby where they have a mixer sending a signal out to powered speakers that are in the corners and the cabling is ran under the carpets along the side and under the steps. They would like to look into some alternatives to the set up.\r\n\r\n\r\n\r\nAlso they have various audio controllers potentiometers that are supposed to control the level of the Audio in the various zones these controllers no longer work. They are very old and I would have to troubleshoot to figure out how theyre connected and how they worked its not really worth it they need to be quoted a new audio system for the entire hotel",
                "object_id": "c998e4bd28be46d5ad25022d476f3e95",
                "owner_id": {
                    "content": "bb7917d8d5d74640b067d24325c92ead",
                    "displayValue": "Danny Chenault",
                    "type": "",
                    "uri": "https://na.longjump.com/networking/rest/user/bb7917d8d5d74640b067d24325c92ead"
                },
                "owner_team_id": {
                    "content": "1",
                    "displayValue": "Operations",
                    "type": "",
                    "uri": "https://na.longjump.com/networking/rest/team/1"
                },
                "record_locator": "1119704103 - SO-22-05789 - Site visit Ritz-Carlton.",
                "search_string": "1119704103 - SO-22-05789 - Site visit Ritz-Carlton. -  I was on site the first issue they are having is in their ballroom they have a CD player that they also use as an aux input, its no longer working. its Made by Beolab The speakers are powered and are proprietary to the device although I did research and find that you can buy a dongle to make the speakers work with other receivers. I tried to send a signal directly to the speakers but was unable to get any sound to go through them from the cable at the CD player. I did notice a couple of them were off. I got on the lift and went up and turned one of them back on and when I went back down the lift died and needed to be charged So I couldnt go up and investigate anymore. I need to verify that the speakers are working if were going to quote them some thing that incorporates the speakers were going to need the dongle from the manufacturer it takes the nine pin din and makes it into two RCAs. I need to verify the cabling is good and or the cable path to run",
                "workflow_owners": "",
