                "multilinkval": "21c64e715c50468faf9e031b2967020d:1355380551",
                "name": "1818439638 - SO-20-05661 - System Offline",
                "notes": "When we arrived on site we found the system off-line just as reported, the processor was in a frozen state and was not communicating. We looked into the network configuration and found that none of the devices were being distributed to the proper IP addresses. All the AV gear lives on the subnet port of the processor which is connected to the Stages network via the LAN port. We were unable to communicate with the processor via USB or network connection, it was unresponsive. The screen on the front panel which usually shows the Crestron logo was black at first and then after a reboot just showed you a mouse icon and a line which wasnt a good sign and lead me to believe that the unit had malfunctioned and was in need of repair. I called Crestron tech support and they directed me to do a system restore to the unit before an RMA is issued. \r\n\r\nI performed the factory reset as recommended and still had no communication at first, however, while I was in the process of getting ready to take the unit out, it rebooted and and we were able to communicate with it again so we tried to reload the code and establish connectivity.\r\n\r\nArt tried to load the code but it gave him an error asking for a software licensing key that came with the unit and was written into the code. We contacted Crestron and inquired about the licensing key and they are looking into getting it for us. Usually you would need the original PO# to obtain this key from them but since NelsonWhite has gone out of business. \r\n\r\nWe obtained the software license key and got the code running. ",
